import './App.css';
import Navbar from './components/navbar';
import Sidebar from './components/sidebar';
import Banner from './components/banner';
import Card from './components/card';

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className='main-container'>
        <Sidebar />
        <Banner />
        <Card />
      </div>
    </div>
  );
}

export default App;
